import Component from './component';

export interface Props {
    variant?: Variants;
}

export enum Variants {
    Default = 'default',
    White = 'white',
    Dark = 'dark',
    Light = 'light',
}

Component.defaultProps = {
    variant: Variants.Default,
};

export default Component;
